import PhotoUser from './PhotoUser/PhotoUser';
import InfoUser from './InfoUser/InfoUser';
import CbUser from './CbUser/CbUser';

const MyInfo = () => {
    return (
        <div style={{display:'flex'}}>
            <PhotoUser/>
            <InfoUser/>
            <CbUser/>
        </div>
    )
}

export default MyInfo;
